import React,{Component} from 'react';
import './style.css'

class FirstComponent extends Component{

   constructor(){
       super();
       this.state = {
           count : 0
       }
   }


    render(){
      return(
        <div className='First'>
             <button className="button" style={{backgroundColor:"green"}} >
                 Button
             </button>
             <span className='count'>{count}</span>
        </div>
      )
    }
}

export default FirstComponent;
